import React, {useState} from 'react';

const Card = ({ loc, dataComponent, data }) => {
    const [width, setwidth] = useState('60vw');
    if(loc==='left'){
        setwidth('28vw');
    }
    const templateStyle = {
        width: width
    }
    const Comp = {dataComponent}
    return (
        <div>
            <br />
                <div className="card text-center" style={templateStyle}>
                    <div className="card-body">
                        <Comp data={data} />
                        <div className="btn-group" role="group" aria-label="Basic outlined example">
                            <button type="button" className="btn btn-outline-primary">수정</button>
                        </div>
                    </div>
                </div>
        </div>
    );
    
}

export default Card;
